using System;
using System.Collections.Generic;
using System.Text;
using NUnit.Framework;
using ServiceStack.Text.Common;

namespace ServiceStack.Common.Tests.Perf
{
    [Ignore("Benchmarks")]
    [TestFixture]
    public class AdhocFastPerfTests
        : PerfTestBase
    {
        public AdhocFastPerfTests()
        {
            //this.MultipleIterations = new List<int> { 1000, 10000, 100000, 1000000 };
            this.MultipleIterations = new List<int> { 10000 };
        }

        public static byte[] ToByteArray(string hexString)
        {
            var numberChars = hexString.Length;
            var bytes = new byte[numberChars / 2];
            for (var i = 0; i < numberChars; i += 2)
            {
                bytes[i / 2] = Convert.ToByte(hexString.Substring(i, 2), 16);
            }
            return bytes;
        }

        [Test]
        public void Compare_small_ConvertBytes()
        {
            var byteArrayValue = new byte[] { 0, 65, 97, 255, 0, 65, 97, 255, 0, 65, 97, 255, 0, 65, 97, 255, };

            CompareMultipleRuns(

                "Convert.FromBase64String", () => Convert.FromBase64String(Convert.ToBase64String(byteArrayValue)),
                "Encoding.Default", () => Encoding.GetEncoding(0).GetBytes(Encoding.GetEncoding(0).GetString(byteArrayValue))
            );
        }

        [Test]
        public void Compare_medium_ConvertBytes()
        {
            var byteArrayValue = ToByteArray("");
            var encodedString = Encoding.GetEncoding(0).GetString(byteArrayValue);
            var base64String = Convert.ToBase64String(byteArrayValue);

            Console.WriteLine("Original length: {0}, Encoding length: {1}, Base65 length: {2}",
                byteArrayValue.Length, encodedString.Length, base64String.Length);

            CompareMultipleRuns(
                "Convert.FromBase64String", () => Convert.FromBase64String(Convert.ToBase64String(byteArrayValue)),
                "Encoding.Default", () => Encoding.GetEncoding(0).GetBytes(Encoding.GetEncoding(0).GetString(byteArrayValue))
            );
        }

        [Test]
        public void Compare_Type_test_with_Parse_Func()
        {
            var testClassWithType = new TestClassWithType { Type = typeof(string) };
            var testClassWithFunc = new TestClassWithFunc { GetValueFn = value => value };

            CompareMultipleRuns(
                "TestClassWithType", () => testClassWithType.GetValue("test"),
                "TestClassWithFunc", () => testClassWithFunc.GetValue("test")
            );
        }


    }

    public class TestClassWithType
    {
        public Type Type { get; set; }

        public object GetValue(string value)
        {
            if (Type == typeof(string))
            {
                return value;
            }

            return null;
        }
    }

    public class TestClassWithFunc
    {
        public ParseStringDelegate GetValueFn;

        public object GetValue(string value)
        {
            if (GetValueFn != null)
            {
                return GetValueFn(value);
            }
            return null;
        }
    }
}